import React from 'react';
import { Link } from 'react-router';
import users from './UsersPage';
import posts from './PostsPage';

class Nav extends React.Component {
    render() {    
      return (
        <table>
          <tr>
            <td><Link to={users} >Users</Link></td>
            <td><Link to={posts}>Posts</Link></td>
          </tr> 
        </table>
      );
    }
  }
  export default Nav;
